import Head from 'next/head'
import Link from 'next/link'
import Layout from '../../components/layout'

function About() {
  return (
    <Layout>
      <Head>
        <title>About</title>
      </Head>
      <h1>Neurotech@Berkeley is super lit.</h1>
    </Layout>
  );
}

export default About;
